संक्षिप्त परिचय

यस गाउँपालिकाको &nbsp; १ नं. वडा &nbsp;साबिकका सेरम गा.बि.स को सम्पूर्ण वडाहरु &nbsp;१-९,सेरम,ठुलोगाउँ ,घुस्बाङ, फुलिबन आदि &nbsp; मिलि बनेको छ । यस वडाको वडा कार्यलय सेरम मा रहेको छ l १ नं. वडाको वडा कार्यलय सुनछहरी &nbsp;गाउँपालिकाको कार्यलय पोबाङ देखि करिब १२ किलोमिटरको पैदल दुरीमा रहेको छ । राष्ट्रिय जनगणना २०६८ अनुसार यस वडामा जम्मा ७६८ घरधुरी र &nbsp; जनसंख्या जम्मा १७५० जना रह्रेको छ । यस वडाको बजारी क्षेत्र फुलिबन बजार हो । यस &nbsp;वडामा &nbsp;३ &nbsp;वटा सरकारी बिद्यालय &nbsp;रहेका छन । जस मध्ये १ वटा माध्यमिक &nbsp;बिद्यालय (कक्षा १-१० सम्म ) र २ वटा आधारभूत &nbsp;बिद्यालय रहेका &nbsp;छन साथै पर्यटनको सम्भावना रहेको तिलाचन दह यसै वडामा अबस्थित रहेको छ l यस वडा बाट स्थानीय तह सदस्य निर्वाचन&nbsp;&nbsp;२०७९&nbsp;मा अध्यक्षको रुपमा धनीमान रोका&nbsp;निर्वाचित हुनु भएको छ ।&nbsp;

