&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;नेपाल सरकार मन्त्रीपरिषदको मिति २०७१/०८/१६ को निर्णय बमोजिम निर्मित बाणगंगा नगरपाकिा वडा नं ४ मिति २०७३/११/२७ गते साविक बाणगंगा नगरपाकिा वडा नं १० बाट वडा नं ४ बनेको हो । धार्मिक ऐतिहासिक पर्यटकिय एवम् व्यापारिक दृष्टिकोणले सामरिक महत्व बोकेको वडा हो । यस वडाको पुर्वमा बाणगंगा नगरपालिका वडा नं ३ को सिमाना पश्चिममा बाणगंगा नदि मोतिपुर वडा नं ८ संग जोडिएको &nbsp;र बाणगंगा नगरपालिका वडा नं ५ को सिमाना संग समेत जोडिएको छ । उत्तरमा वडा नं ४ को जंगल क्षेत्र भित्र अवस्थित यस वडाको क्षेत्रफल करिब १०.४३ वर्ग मिटर रहेको छ र वि.स. २०६८ सालको जनगणना अनुसार ७७०३ जनसंख्या भएको र मतदाता संख्या ३०४५ रहेको &nbsp;भएता पनि हाल द्रुत गतिमा भइरहके बसाईसराई सहरिकरण र विकासको कारण दिनानुदिन जनसंख्या बढिरहेको छ र बि.स.२०७५सालको संसदिय र प्रदेश सभा निर्वाचनको मतदाता संख्या &nbsp;५३६७ छ भने घर धुरी संख्या २०२७&nbsp;छ र महिला ५०६५&nbsp;पुरुष ५२२९&nbsp; कुल जनसंख्या १०२८९&nbsp;को बसोवास भएको यस वडामा करिव &nbsp;३० प्रतिशत आदिबासि थारु जातिको बसोवास छ भने अन्य ७० प्रतिशत पहाडिया मुलका मानिसहरुको बसोवास रहेको छ ।&nbsp;
&nbsp; &nbsp;साविकको गजेहडा गा.वि.स.का वडा नं १,२,७ वडाहरु गाविएर बनेको यस बाणगंगा नगरपालिका वडा नं ४ लाई महेन्द्र राजमार्गले काटेको छ । बाणगंगा नगरपालिकाकै धरोहर कपिलवस्तु सामुदायिक अस्पताल समेत रहेको छ । यस वडा भित्र चारनम्बर देखि सदरमुकाम तौलिहवा जोड्रने महत्वपुर्ण &nbsp;सडक रहेको छ चारनम्बर ढोरपाटन सडक तथा लक्ष्मणघाट गजेहडा रुपन्देही (गरगरे) &nbsp;कृषि सडक समेत छ । (कपिलवस्तुकै ऐतिहासिक कृषि तथा प्रयटकीय मेला) बुद्ध रंगशाला मा प्रत्येक बर्ष लाग्ने गरेको छ । युवाहरुको घरोहर वयलफेयर सोसाइटि र उद्योग बाणिज्य संघको कार्यालय समेत रहेको छ । सिद्धिपुर,दरखास्तमा दुर्गा मन्दिर शिवालय मन्दिर,हरिहरपुरमा शिवालय मन्दिर ,गजेहडामा बैष्णवदेवि मन्दिर ,शिवालय मन्दिर र ठाकुरापुरमा दुर्गा मन्दिर डुगहवामा दुर्गा मन्दिर गरि जम्मा ११ मठ मन्दिर भएका र गाउं गाउंमा थारु डिवहारहरु यस वडाका महत्वपुर्ण धार्मिक महत्वका क्षेत्रहरु हुन् भने सिंचाइका लागि मर्थि मुल गजेहडाको जगैया मुल झुगा कारिगिरिया मुल,गैडहवा मुल &nbsp;समेत रहेका छन् ।
&nbsp;१४ चौध वटा सहकारी तथा ११(एघार ) वटा बैक ले सेवादिदै आएका छन् &nbsp;तिन (३) वटा सरकारी बिद्यालय र पांच (५) वडा निजि विद्यालयले यस वडा बाट सेवा प्रदान गर्दै आएका छन् यसै वडा खेलकुदकै अब्वल वडाको रुपमा रहेको छ खेलकुदको मैदानका रुपमा बुद्ध रंगशाला खेल मैदाल तथा शान्ति नि.मा.वि. को खेल मैदान रहेको छ &nbsp;साथै शान्ति नि.मा.वि.मा करिव २ विगाहा जमिनमा &nbsp;आफै मुल उठ्रने(सिमसार) पोखरी समेत रहेको छ यस वडामा २ दुइ सामुदायीक बन रहेका छन् । &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;
