वडा कार्यालय रहेको स्थान :- ५ नं. वडा कार्यालय

कोहलपुर नगरपालिकाको वडा नं ७&nbsp;&nbsp;साबिक कोहलपुर&nbsp;गाउँ विकास समितिका वडा नं. ६ र ७ मिलेर बनेको हो | यस वडाका जनप्रतिनिधि दिपकजंग शाह&nbsp;&nbsp;२०७४ को स्थानीय निर्वाचनबाट वडा अध्यक्ष पदमा निर्वाचित हुनुभएको हो |

&nbsp;



&nbsp;

कोहलपुर नगरपालिकाको वडा नं&nbsp; ८&nbsp;साबिक कोहलपुर&nbsp;गाउँ विकास समितिका वडा नं. ८ बाट&nbsp; बनेको हो | यस वडाका जनप्रतिनिधि रेशम बहादुर&nbsp;खत्री&nbsp;&nbsp;२०७४ को स्थानीय निर्वाचनबाट वडा अध्यक्ष पदमा निर्वाचित हुनुभएको हो ।



&nbsp;

&nbsp;

&nbsp;

बाँसगढी नगरपालिका वडा नं ७ साविकका गा वि स १,६ र ८ मिलेर वनेको वडा हो । यस वडा कार्यालय २८°२४'३१'' उत्तरी अक्षांस ८१°४६'३५'' &nbsp;पुर्वि देशान्तर र समुन्द्रि सतह देखि १३६.७ M उचाइमा रहेको छ । साविकको डेउढाकला गा वि स भवननै हाल यस वडा कार्यालय हो ।&nbsp;

यस वडा अन्तर्गतका ठुला गाँउहरुमा बड्कीडेउढा, छोट्की डेउढा, वसन्तपुर गाँउ, राधाकृष्ण टोल, हरैया टोल, सगाहपुर, कालावन्जर, बाउनपुर, चौधरीपुर, गौरीपारा आदी पर्दछन ।

&nbsp;

यस वडाको सिमाना पूर्वमा दमौली नयाँ वस्ती, पश्चिममा हरैया गाँउ भागीराम थारुको घर, उत्तरमा राधाकृष्ण टोलको रामहर्क थारुको घर, र दक्षिणमा गौरीपारा गाँउको सिमाना पर्दछ । उत्तरी भागमा यस वडालाइ छिमेकी गाँउपालिका वढैया गाँउपालिकाले छोयको छ । वडामा प्राय गरेर थारु, नेपाली, मधेसी आदि भाषा प्राय वोल्ने गरिन्छ । यस वडा क्षेत्रमा वढि जसो मधेसी र थारु जातिको वाहुल्यता बढी रहेको छ ।

&nbsp;

यस वडा अन्तर्गतका सामुदायिक वनहरु बन बर्दियम सामुदायिक वन डेउढा, चकियाबाबा सामुदायिक वन छोट्की डेउढा, माहादेवा युवा सामुदायिक वन छोट्की डेउढा, गणेशशक्ती सामुदायिक वन कालाबन्जर, निलकण्ठ सामुदायिक वन सघाहपुर बाउनपुर, दशरथ सामुदायिक वन गौरीपारा, चौधरीया सामुदायिक वन चौधरीपुर आदी रहेका छन ।

&nbsp;

यस वडा अन्तर्गतका संघसस्थाहरुमा शिलशिला महिला वचत उधमशिल तथा ऋण सहकारी संस्था लि डेउढा, लालि युवा क्लव छोट्की डेउढा, वसन्तपुर युवा क्लव वसन्तपुर, मधेसी महिला सख्खी समाज सुधार सहकारी संस्था सघाहपुर आदी रहेका छन ।

यस वडामा मा वि विद्यालयमा भिकृटी मा,वि डेउढाकला मात्र एक विद्यालय रहेको छ । प्रा वि विद्यालयहरुमा काली गण्डकी आधारभुत विद्यालय रहेको छ । नि मा वि विद्यालयमा दशरथचन्द नि मा वि गौरीपारा आदी रहेका छन । सिचाइका निमित्त बबै सिचाइ आयोजना रहेको छ ।

यस वडामा प्राचिन भनाइ अनुसार १०० वर्ष भन्दा अगाडी झुर्रा थारुको घरमा बाँझो खेतमा जोत्दा हलो अड्किएको र खनेर हेर्दा भगवानको मुर्ति फेला परेको र त्यसलाइ भगवानको रुप मानी पुजा गर्ने चलन रहेको छ ।

